import React from 'react'
import './asideBar.scss'
import Logo from './components/Logo/Logo'
import CategoryList from './components/CategoryList/CategoryList'

const AsideBar = () => {
  return (
    <aside className='asideBar'>
      <Logo />
      <CategoryList />
    </aside>
  )
}

export default AsideBar
